★クロックスのサンダルシューズ！<br>
<br>
●「クロスライト」素材を使用し、軽い履き心地と快適なクッション性を実現！<br>
●アッパー全体に施された迷彩柄のデザイン！<br>
●かかとには足にしっかりフィットするストラップ付き。<br>
●ややゆとりのあるリラックスタイプ。幅広で快適、ほどよいフィット感！<br>
<br>
<font color="red"><b>※こちらの商品は、透明袋で保管されているもので箱は付属致しませんのでご了承ください。</b></font><br>
<br>
■素材<br>
甲：合成樹脂、ゴム<br>
底：合成樹脂<br>
<br>
※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
