<BR>
<BR>
■サイズ 22.0cm、23.0cm、24.0cm<br>
こちらの商品はややゆとりのある「リラックスタイプ」の商品です。<br>
普通、細身の方は足の実寸サイズ、甲高、幅広の方は足の実寸+1サイズをお勧めします。<br>
丁度良いと感じるサイズには個人差があります。あくまでもサイズをお選びになる際のご参考程度にお考えください。<br>
