★キーンのサンダル！<br>
<br>
●幅8mmのコードを使用したユニークなデザインが魅力。<br>
●足の形に合わせて自在に動く二本のコードが、足をしっかり包みつつ自由な動きを可能にします<br>
●軽量ＰＵミッドソールが耐久性と快適性を発揮し、ラバーアウトソールが確かなグリップを実現。<br>
●足裏の形状に合わせた立体成型フットベッドと、防滑性に優れる細かな切れ込みの入ったソールが快適な履き心地を提供します。<br>
●ゴムひもとドローコードシステムのシューレースでフィッティングも簡単。<br>
●履きやすくカジュアルなデザインは、タウンユースにもおすすめです。<br>
